import {Container} from '../styles/stylesPage/cadastroStyles'
import Imput from './inputs/input'
import Link from 'next/link'
import * as Yup from 'yup'
import { Formik, Form, Field, ErrorMessage } from 'formik';
const avaliar = Yup.object().shape({
    nome_guia: Yup.string().min(3, t('NameInputError')).required(t('FieldRequired')),
    senha_guia: Yup.string().min(8, t('PasswordInputError')).required(t('FieldRequired')).max(15, 'A quantidade máxima é 15'),
    email_guia: Yup.string().email(t('EmailInputError')).required(t('FieldRequired')),
    // nacionalidade_guia:Yup.string().required(t('FieldRequired')),
    confirmPassword: Yup.string().oneOf([Yup.ref('senha_guia'), null], t('ConfirmPasswordInputError')).required(t('FieldRequired')),
     // idade_guia:Yup.number().moreThan(17,t('AgeInputError')).required(t('FieldRequired')),
     // telefone_guia: Yup.string().required(t('FieldRequired'))
  })
  async function CadastroElementos (values) {
    const data = {
      nome_guia: values.nome_guia,
      email_guia: values.email_guia,
      senha_guia: values.senha_guia,
      // idade_guia:values.idade_guia
      // telefone_guia: values.telefone_guia,
      // pais_guia:values.nacionalidade_guia,
     
    }
    /** caso tenha algum problema com a conexão mostra o erro específico */
    try {
      const response = await api.post('guia', data)
      alert(JSON.stringify(response.data.message))
      history.push('/login')
    } catch (err) {
      // alert('Erro no estabelecer conexão. ' + err.response.data.message)
      console.log(data)
      alert('Erro no estabelecer conexão. ' + err)
    }
  }
const Cadastro : React.FC=()=>{
    return(
           <Container>
               <Imput/>
               <Formik
       initialValues={{ email: '', password: '' }}
       validationSchema={avaliar}
       onSubmit={(values) => {
            CadastroElementos(values)
       }}
     >
       {({values, dirty, isValid, handleChange,isSubmitting}) => (
         <Form>
           <Field type="text" name="name" as={Imput} />
           <ErrorMessage name="name" component="div" />
           <Field type="email" name="email" as={Imput} />
           <ErrorMessage name="email" component="div" />
           <Field type="password" name="confirmPassword" as={Imput}/>
           <ErrorMessage name="password" component="div" />
           <Field type="password" name="confirmPassword" as={Imput}/>
           <ErrorMessage name="password" component="div" />

           <button type="submit" disabled={isSubmitting}>
             Submit
           </button>
         </Form>
       )}
     </Formik>
               <Link href='/'>
                   <a>Login</a>
               </Link>
            </Container>
    )
}
export default Cadastro
